import './App.css';
import Header from './components/Header';
import Sidebar from './components/Sidebar';
import Article from './components/Article';
import Footer from './components/Footer';

function App() {
  return (
    <div className="App">
      <Header />
      <div className="content">
        <Sidebar />
        <Article />
      </div>
      <Footer />
    </div>
  );
}

export default App;
